import './App.css';
import Formulario from './pages/Login.js';
import EntraCaixa from './pages/EntrarCaixa';
import { BrowserRouter as Router, Route, Routes, BrowserRouter } from 'react-router-dom';


function App() {
  return (
    <div className="App-header">
      <Router>
      <Formulario>
        <Routes>

         <Route path="./pages/EntrarCaixa" element={<EntraCaixa/>}/>

        </Routes>
        </Formulario>

      </Router>

    </div>
  );
}

export default App;
